import React, { Component, createRef } from 'react'

export default class SearchBar extends Component {
    constructor(props) {
        super(props);
        this.state = {
            value: ""
        };

        this.inputRef = createRef();
    }

  render() {
    return (
      <div className="searchbar">
          <form>
          <input type="text" ref={this.inputRef} className="searchbar__input"/>
          <input type="submit" className="searchbar__btn" onClick={() => this.props.findIP(this.inputRef.current.value)}><img className="searchbar_arrow" src="/images/icon-arrow.svg"/></input>
          </form>
    
      </div>
    )
  }
}
